function readFileFixedStyle(file, badids, badcomments){
  fetch(file).then(response => response.text()).then(function(x){
    badids = badids.split(';').map(x => parseInt(x));
    badcomments = badcomments.split(';')
    var regexp = /[CSONF]/g; // Should be expanded to all atoms?
    var match,matches = []; 
    while( ( match = regexp.exec(x) ) != null ){ 
        matches.push(match[0]);
    } 
    var idx = [...Array(matches.length).keys()]
    let diff = idx.filter(x => !badids.includes(x)) 
    stage.loadFile(file).then(function(o){
      // Create Frame, balls don't render, nor do bonds
      o.addRepresentation('ball+stick', {aspectRatio:0, radius:0,
                                           multipleBond:'symmetric'}); 
      atom_info = o.object.atomMap.dict;
      atom_info_array = [];
      for (var key in atom_info) {
          atom_info_array.push(key.split('|')[0]);
      }
      console.log(atom_info)
      console.log(atom_info_array)
      o.autoView()
      // Draw Good Atoms + Bonds
      o.addRepresentation('ball+stick',{
          aspectRatio:2, sele:'@'.concat(diff), multipleBond:'symmetric'});

      let shape = new NGL.Shape("shape", {dashedCylinder: true});
      bonds = o.object.bondStore;        
      n = bonds.atomIndex1;
      m = bonds.atomIndex2;

      n.forEach((num1, index) => {
        const num2 = m[index];
        if (badids.includes(num1) || badids.includes(num2) ){
                acoord = [o.object.atomStore.x[num1],
                          o.object.atomStore.y[num1],
                          o.object.atomStore.z[num1]];
                bcoord = [o.object.atomStore.x[num2],
                          o.object.atomStore.y[num2],
                          o.object.atomStore.z[num2]];      
                var sx = bcoord[0] - acoord[0]; 
                var sy = bcoord[1] - acoord[1];
                var sz = bcoord[2] - acoord[2];
                
                length = (sx**2 + sy**2 + sz**2)**.5;
                var unitSlopeX = sx / length;
                var unitSlopeY = sy / length;
                var unitSlopeZ = sz / length;
                
                a2coord = [
                           acoord[0] + (unitSlopeX * .1),
                           acoord[1] + (unitSlopeY * .1),
                           acoord[2] + (unitSlopeZ * .1)
                          ];
                b2coord = [
                           bcoord[0] - (unitSlopeX * .1),
                           bcoord[1] - (unitSlopeY * .1),
                           bcoord[2] - (unitSlopeZ * .1)
                          ];
                // Create handle for count is exceeded!
                // order is startxyz, endxyz, colour, radius, name
                a1c = ElementColors[o.object.atomMap.list[num1].element];
                a2c = ElementColors[o.object.atomMap.list[num2].element];
                
                bond_label = 'bond: '.concat(atom_info_array[num1],'-', atom_info_array[num2])
                
                shape.addCylinder(acoord, bcoord, [a1c[0]/255,a1c[1]/255,a1c[2]/255], .1, bond_label); // bond comment goes here! ,'this is bad'
          
                if (o.object.atomMap.list[num1].element == o.object.atomMap.list[num2].element){
                  shape.addCylinder(a2coord, b2coord, [208/255,208/255,224/255], .1 , bond_label); // bond comment goes here! ,'this is bad'
                } else {
                  shape.addCylinder(a2coord, b2coord, [a2c[0]/255,a2c[1]/255,a2c[2]/255], .1, bond_label); // bond comment goes here! ,'this is bad'
                }   
        }
      }); 
      var bondComp = stage.addComponentFromObject(shape);
      for(id in badids){
        let origin = [o.object.atomStore.x[badids[id]], 
                      o.object.atomStore.y[badids[id]], 
                      o.object.atomStore.z[badids[id]]
                     ];
        atom_label = 'atom: '.concat(atom_info_array[badids[id]], ' | ', badcomments[id])
        shape.addSphere(origin, [0,0,0], .2, atom_label); // Hack to get atom labels to render.
        // Probably need to create a new shape constructor, with minimum opacity and then render it as needed...
        let m = refmesh.map(function (v,i) {return origin[i % 3] + v;});
        let eleC = ElementColors[o.object.atomMap.list[badids[id]].element]
        var col2 = Array(m.length).fill(1).map(function (v,i){
          return eleC[i%3]/255
        }); 
        var col = new Float32Array(col2)          
        var meshBuffer = new NGL.MeshBuffer( {
              position: new Float32Array(m),
              color: col
        })
        shape.addBuffer(meshBuffer);
        var shapeComp = stage.addComponentFromObject(shape);
        shapeComp.addRepresentation("buffer");
      };
    });
  });
};

function readMap(file, colour, opacity, isolevel, smooth, boxSize, wireframe){
  fetch(file).then(function(x){
    stage.loadFile(file, {ext:'ccp4'}).then(function(o){
      o.addRepresentation('surface', {
        color: colour, 
        isolevel: isolevel, 
        smooth: smooth, 
        boxSize: boxSize, 
        contour: wireframe===true, 
        wrap: true, 
        opacity: opacity, 
        opaqueBack: false})
    })
  })
}


